import React, { Component } from 'react';
import './App.css';

import { Col, Grid,Table, Row} from 'react-bootstrap';

import Header from "./header";


export default class App extends Component {
  render() {
    return (
        <Table striped bordered condensed hover>
          <thead>
          <tr>
            <th  >#</th>
            <th  >Codigo</th>
            <th  >Nombre</th>
            <th  >Vence</th>
            <th  >Categoria</th>
            <th  >Precio</th>
            <th  >Accion</th>
          </tr>
          </thead>
          <tbody>

          </tbody>
        </Table>
    );
  }
}
